import React from 'react';
import styles from '../components/box.module.css';
import { Link } from 'react-router-dom';
function Box(props) {


  return(
     <Link>

      <span className={styles.box}> 
       <p>
        {props.text}
       </p>
      </span>
      </Link>
  );
}

export default Box;
